window.bookSummaryJSON = "<p>In <i>The Do-It-Yourself Bailout,</i> author Kenny Golde explains how he completely and legally eliminated $222,000 in credit card debt, without filing for bankruptcy or destroying his credit score. Golde provides a step-by-step handbook on all facets of how to initiate settlement negotiations with banks, how to handle collection agencies, how to separate your emotions from your debt, and much, much more. </p> <p>The AudioGO deluxe version of the <i>DIY Bailout</i> book will include a special training seminar, not offered in the book, that covers the following topics: The Five Essential Steps toward True Financial Health, a proven, effective method for talking about debt settlement with collection agents; how long debt settlement might take; how to release the pain, fear, stress, shame, guilt, or anxiety that often comes with debt; how to take control of your financial life once and for all, and never give it up; what a proper debt settlement agreement must contain; how debt settlement could affect your credit score and why it may not matter; and how to settle your debts for less than you owe even if you don't think you can afford an upfront payment. Why wait? Start getting out of debt today!</p>"; 
